import React from 'react';
import './home.css';
import Footer from './footer';
import book from './homeAssets/book.png';
import chest from './homeAssets/chest.png';
import reward from './homeAssets/trophy.png';

function Home() {
  return (
    <div className="app-container">
      <header className="header">
        <div className='sectionTitle'>
          <h1>Chapitre 1</h1>
          <p>Apprendre l'alphabet</p>
        </div>
        <img src={book} alt="lesson-icon" className="iconHeader" />
      </header>

      <main className="main-content">
        <div className="publicity">
          <h1>Publicity</h1>
        </div>
        <div className="lessonSection">
          <img src={chest} alt="chest-icon" className="icon" />
          <img src={reward} alt="reward-icon" className="icon" /></div>
        <div className="publicity">
          <h1>Publicity</h1>
        </div>

      </main>
      <Footer/>

    </div>
  );
}

export default Home;
